import React from 'react';
import styles from './ViewRequest.module.css';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const ViewRequest = ({ requests }) => {
  const navigate = useNavigate();

  const handleSubmit = (selectedRequest) => {
    navigate('/requestdetail', { state: { request: selectedRequest } });
  };
  
  return (
    <div className={styles.container}>
      <h3 className={styles.heading}>View My Requests</h3>
      {requests.length === 0 ? (
        <p className={styles.noRequests}>No requests yet.</p>
      ) : (
        <ul className={styles.list}>
          {requests.map((req, index) => (
            <li key={index} className={styles.listItem}>
              <strong>{req.service}</strong> - {req.description}<br />
              <button type="button" onClick={() => handleSubmit(req)}>View Request Detail</button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default ViewRequest;
